// React
import React from "react";
import PropTypes from "prop-types";
import { Link } from "react-router-dom";

function MenuCollections(props) {
  const { menuItems } = props;

  return (
    <div id="menuContainer">
      <div id="menu">
        {menuItems.map((menuItem, index) => {
          const route = menuItem["Route"];
          const title = menuItem["Title"];
          return (
            <Link
              className="menuOption clickable"
              to={route}
              key={`menu-${route}`}
            >
              <>
                <span className="menuOptionTitle">{title}</span>
              </>
            </Link>
          );
        })}
      </div>
    </div>
  );
}

MenuCollections.propTypes = {
  menuItems: PropTypes.array,
};

export default MenuCollections;
